SET NAMES utf8;
SET time_zone = '+00:00';
SET foreign_key_checks = 0;
SET sql_mode = 'NO_AUTO_VALUE_ON_ZERO';

SET NAMES utf8mb4;

DROP TABLE IF EXISTS `season`;
CREATE TABLE `season` (
  `SeasonYear` char(5) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  PRIMARY KEY (`SeasonYear`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


DROP TABLE IF EXISTS `player`;
CREATE TABLE `player` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `Player` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `Team` varchar(3) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `Age` int(11) NOT NULL,
  `GP` int(11) NOT NULL,
  `MIN` float NOT NULL,
  `PTS` float NOT NULL,
  `FGM` float NOT NULL,
  `FGA` float NOT NULL,
  `FG` float NOT NULL,
  `3PM` float NOT NULL,
  `3PA` float NOT NULL,
  `3P` float NOT NULL,
  `FTM` float NOT NULL,
  `FTA` float NOT NULL,
  `FT` float NOT NULL,
  `OREB` float NOT NULL,
  `DREB` float NOT NULL,
  `REB` float NOT NULL,
  `AST` float NOT NULL,
  `TOV` float NOT NULL,
  `STL` float NOT NULL,
  `BLK` float NOT NULL,
  `PF` float NOT NULL,
  `PlusMinus` float NOT NULL,
  `Position` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `Stop1Perimeter` double NOT NULL,
  `Stop2Perimeter` double NOT NULL,
  `StopPerimeter` double NOT NULL,
  `AverageTeamStopPerimeter` double NOT NULL,
  `PlayerContributionPerimeter` double NOT NULL,
  `TeamDefensePerimeter` double NOT NULL,
  `PlayerTeamPerimeter` double NOT NULL,
  `PDEF` double NOT NULL,
  `Stop1Rim` double NOT NULL,
  `Stop2Rim` double NOT NULL,
  `StopRim` double NOT NULL,
  `AverageTeamStopRim` double NOT NULL,
  `PlayerContributionRim` double NOT NULL,
  `TeamDefenseRim` double NOT NULL,
  `PlayerTeamRim` double NOT NULL,
  `RDEF` double NOT NULL,
  `DEF` double NOT NULL,
  `SeasonYear` char(5) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `NbaPlayerId` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `SeasonYear` (`SeasonYear`),
  CONSTRAINT `player_ibfk_1` FOREIGN KEY (`SeasonYear`) REFERENCES `season` (`SeasonYear`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

